  false,\n\t\"url\": null,\n\t\"notes\": \"The Kenai Wilderness Management Guide is
  a description, interpretation, and synthesis of Congressional legislation, Department
  of the Interior regulation, and Fish and Wildlife Service policy applicable to the
  Kenai Wilderness in the Kenai National Wildlife Refuge.  There are four parts to
  the management guide. Part I, Wilderness Management by the Fish and Wildlife Service,
  presents basic wilderness management guidelines and practices for the staff of the
  Kenai NWR. Part II, Wilderness Management by Other Agencies, similarly presents
  additional guidelines and practices for the personnel of other Federal and State
  agencies involved with the management of the Kenai Wilderness.  Part III, Wilderness
  Use by the General Public, presents additional guidelines and practices applicable
  to the use of the Kenai Wilderness by the general public. Part IV, Wilderness Use
  by Commercial Operators, presents additional guidelines and practices for the commercial
  use of the Kenai Wilderness. It should be noted that the guidelines described in
  Part I generally underlie the guidelines of the other parts as well.\",\n\t\"license_title\":
